【長財布 財布 メンズ ブランド 人気 水牛革 レザー 革】
<br>

<br>
お洒落を愛する人の為に生まれたブランド「farian-ファリアン-」<br>
流行に敏感で「自分」をしっかり持った方にお使い頂いてもらうために、<br>
使い込むほどに味を増し、長くお使い頂ける製品を提供しています。<br><br>


素材にバッファローレザーを使うことで、<br>
頑丈な作りだけでなく、その革独特の肌触りと艶が<br>
最大限まで発揮されて作られています。<br><br>

ライダースウォレットでは珍しいラウンドファスナータイプで、<br>
使い勝手が良く、ウォレットロープも付属しています。<br>

また側面にもロープが巻かれておりとてもお洒落。<br><br>

内部は収納スペースが多い仕様となっおり、<br>
小銭入れのサイドにはカードポケットがあり、<br>
頻繁に使うカードを入れておけばサッと取り出すことが出来ます。<br><br>


専用BOX入りですのでプレゼントにも最適です。<br>
<br>


<br>
◆素材◆<br>
外側/バッファローレザー、内側/合成皮革
<br><br> 
◆本体サイズ◆<br>
約 H21.5×W10.5×D3.2cm<br><br>

◆仕様◆<br>
札入れ×2、ファスナー式小銭入れ×1、カードポケット×9、フリースペース×6
<br><br><br>

