<br>

【長財布 財布 メンズ ラウンドファスナー 馬革 スター ブランド 人気 レザー 革】
<br>

<br>
■ブランドコンセプト<br><br>


人がレザーアイテムを選ぶ上で最も重要なのは、<br>

『上質な素材』『心引かれるデザイン』『実用的な機能性』<br>
この3つの要素だとマニエラは考えます。<br><br>

"本当に必要なものを、本当に必要なかたちでつくる。"<br>
それは、繊細で巧みまれな日本の職人の伝統的な加工技術と、<br>
斬新で新しいアイデアの融合によって実現されます。<br><br>

生まれて死ぬまでの間に、皮革製品を一度も手にした事が無い人は、<br>
存在しないといっても過言ではありません。<br><br>

それは遥か昔から、人の暮らしの中に皮革製品が必要不可欠であり、<br>
皮革という素材が人に愛される魅力を持つことの証明なのです。<br><br>

そんなレザーの良さを、もっと多くの人に<br>
知ってほしいという想いがマニエラを誕生させました。<br><br>

どんなに時代が進んでも決して衰退することのないレザーアイテムを、<br>
これからの時代に合わせ進化させていくことこそが<br>
マニエラが考えるモノ作りの核であり、<br>
決して揺るぐことの無い製造理念なのです。
<br>
<br>
■製品について
<br><br>
マニエラの製品、その全てが、日本の職人たちの<br>
高い技術によってハンドメイドで製造されています。<br><br>

実績、信頼のある素材を厳選して用いた安定感と、<br>
実績の無い未知なる可能性を秘めたアイデアを、<br>
デザインとして製品に落とし込むセンスがマニエラの最大の特徴です。<br><br>

また、永く有用する為のポイントとなるパーツ選びにも拘りを持っていて、<br>
その拘りはYKK社製最高峰のエクセラファスナーなどを使用している点からも、<br>
強く感じ取ることができます。<br><br>

数年使用して現れるエイジング(経年変化)は、<br>
使い手や製品によってそれぞれ異なります。<br>
製品が完成するのは、まさにその時だと考えるマニエラは、<br>
丈夫で永く愛される製品作りを心がけています。 
<br>
<br>


